import { BrowserRouter as Router,Route, Link } from "react-router-dom";
import {Switch} from "react-router-dom";
import Topbar from "./components/topbar/Topbar";
import Home from "./pages/home/Home";

function App() {
  return (
    <Router>
    <Topbar />
    <Switch>
      <Route path="/">
        <Home />
      </Route>
    </Switch>
    </Router>
  );
}

export default App;
